import React from 'react';
import {
  BrowserRouter as Router,
  Route, Redirect, Switch
} from 'react-router-dom';
import './App.css';

const App = () => {
  return (
    <Router>
      <Switch>
      <h3>start with Router</h3>
      <Route path="/" exact={true} element={<h2>hi from route</h2>} />

      </Switch>
    </Router>
  );
};


export default App;
